const Precences = () => {
  return (
    <table className="attendance-table">
      <thead>
        <tr>
          <th>#</th>
          <th>Nom</th>
          <th>Heure d'arrivée</th>
          <th>Heure de départ</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>John Doe</td>
          <td>08:00</td>
          <td>17:00</td>
        </tr>
      </tbody>
    </table>
  );
};

export default Precences;
